import React, { useState } from 'react';
import TeacherLayout from '../../components/teacher/sidebar';
import '../../css/teacher/calendar.css';
import { Calendar, ChevronLeft, ChevronRight, List, Grid } from 'lucide-react';


const deadlinesData = [
  { id: 1, title: 'Midterm Grades Due', date: '2025-04-28', course: 'CS101' },
  { id: 2, title: 'Final Project Submissions', date: '2025-05-15', course: 'MATH202' },
  { id: 3, title: 'Department Meeting', date: '2025-04-26', course: 'Admin' },
  { id: 4, title: 'Student Evaluations Due', date: '2025-05-10', course: 'ENG105' },
  { id: 5, title: 'Curriculum Review', date: '2025-05-05', course: 'Admin' },
  { id: 6, title: 'Lab Reports Grading', date: '2025-04-30', course: 'PHY201' },
  { id: 7, title: 'Parent-Teacher Conference', date: '2025-05-12', course: 'Admin' },
  { id: 8, title: 'Research Proposal Deadline', date: '2025-05-20', course: 'BIO303' }
];

// Generate calendar days
const generateCalendarDays = (year, month) => {
  const firstDay = new Date(year, month, 1);
  const lastDay = new Date(year, month + 1, 0);
  
  const days = [];
  const startingDayOfWeek = firstDay.getDay();
  
  // Add empty slots for days before the 1st of the month
  for (let i = 0; i < startingDayOfWeek; i++) {
    days.push({ day: null, isCurrentMonth: false });
  }
  
  // Add days of the current month
  for (let day = 1; day <= lastDay.getDate(); day++) {
    days.push({ day, isCurrentMonth: true });
  }
  
  return days;
};

const InstructorCalendar = () => {
  const [viewMode, setViewMode] = useState('calendar'); // 'calendar' or 'list'
  const [currentDate, setCurrentDate] = useState(new Date());
  
  const year = currentDate.getFullYear();
  const month = currentDate.getMonth();
  const calendarDays = generateCalendarDays(year, month);
  
  const monthNames = [
    'January', 'February', 'March', 'April', 
    'May', 'June', 'July', 'August', 
    'September', 'October', 'November', 'December'
  ];
  
  const weekdays = ['Sun', 'Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat'];
  
  const handlePrevMonth = () => {
    setCurrentDate(new Date(year, month - 1, 1));
  };
  
  const handleNextMonth = () => {
    setCurrentDate(new Date(year, month + 1, 1));
  };

  // Filter deadlines for the current month
  const currentMonthDeadlines = deadlinesData.filter(deadline => {
    const deadlineDate = new Date(deadline.date);
    return deadlineDate.getMonth() === month && deadlineDate.getFullYear() === year;
  });

  // Get deadlines for a specific day
  const getDeadlinesForDay = (day) => {
    if (!day) return [];
    const formattedDate = `${year}-${String(month + 1).padStart(2, '0')}-${String(day).padStart(2, '0')}`;
    return deadlinesData.filter(deadline => deadline.date === formattedDate);
  };

  // Sort deadlines by date
  const sortedDeadlines = [...deadlinesData].sort((a, b) => new Date(a.date) - new Date(b.date));

  return (
    <TeacherLayout>
      <div className="p-6">
        <div className="flex justify-between items-center mb-6">
          <h1 className="text-2xl font-bold">Instructor Calendar</h1>
          <div className="flex items-center space-x-4">
            <button 
              onClick={() => setViewMode('calendar')} 
              className={`p-2 rounded-md ${viewMode === 'calendar' ? 'bg-blue-100 text-blue-600' : 'hover:bg-gray-100'}`}
            >
              <Grid size={20} />
            </button>
            <button 
              onClick={() => setViewMode('list')} 
              className={`p-2 rounded-md ${viewMode === 'list' ? 'bg-blue-100 text-blue-600' : 'hover:bg-gray-100'}`}
            >
              <List size={20} />
            </button>
          </div>
        </div>

        {viewMode === 'calendar' ? (
          <div className="bg-white rounded-lg shadow">
            <div className="p-4 border-b flex justify-between items-center">
              <button onClick={handlePrevMonth} className="p-1 hover:bg-gray-100 rounded-full">
                <ChevronLeft size={20} />
              </button>
              <h2 className="text-xl font-semibold">{monthNames[month]} {year}</h2>
              <button onClick={handleNextMonth} className="p-1 hover:bg-gray-100 rounded-full">
                <ChevronRight size={20} />
              </button>
            </div>

            <div className="grid grid-cols-7 border-b">
              {weekdays.map(day => (
                <div key={day} className="py-2 text-center text-sm font-medium text-gray-500">
                  {day}
                </div>
              ))}
            </div>

            <div className="grid grid-cols-7">
              {calendarDays.map((day, index) => {
                const dayDeadlines = day.day ? getDeadlinesForDay(day.day) : [];
                return (
                  <div 
                    key={index} 
                    className={`min-h-24 p-2 border-t border-l ${index % 7 === 6 ? 'border-r' : ''} ${!day.isCurrentMonth ? 'bg-gray-50' : ''}`}
                  >
                    {day.day && (
                      <>
                        <p className={`text-sm text-right ${dayDeadlines.length > 0 ? 'font-bold' : ''}`}>
                          {day.day}
                        </p>
                        <div className="mt-1">
                          {dayDeadlines.map(deadline => (
                            <div 
                              key={deadline.id} 
                              className="text-xs p-1 mb-1 rounded bg-blue-100 text-blue-800 truncate"
                              title={`${deadline.title} (${deadline.course})`}
                            >
                              {deadline.title}
                            </div>
                          ))}
                        </div>
                      </>
                    )}
                  </div>
                );
              })}
            </div>
          </div>
        ) : (
          <div className="bg-white rounded-lg shadow p-4">
            <h2 className="text-xl font-semibold mb-4">Upcoming Deadlines</h2>
            <div className="space-y-4">
              {sortedDeadlines.map(deadline => {
                const deadlineDate = new Date(deadline.date);
                return (
                  <div key={deadline.id} className="flex items-start p-3 border rounded-lg hover:bg-gray-50">
                    <div className="flex-shrink-0 bg-blue-100 text-blue-800 rounded-md p-2 text-center w-16">
                      <div className="text-xs font-medium">{monthNames[deadlineDate.getMonth()].substring(0, 3)}</div>
                      <div className="text-lg font-bold">{deadlineDate.getDate()}</div>
                    </div>
                    <div className="ml-4">
                      <h3 className="font-medium">{deadline.title}</h3>
                      <p className="text-sm text-gray-600">{deadline.course}</p>
                    </div>
                  </div>
                );
              })}
            </div>
          </div>
        )}

        {/* Summary section - showing upcoming deadlines */}
        <div className="mt-6 bg-white rounded-lg shadow p-4">
          <h2 className="text-xl font-semibold mb-4">This Month's Deadlines</h2>
          {currentMonthDeadlines.length > 0 ? (
            <div className="space-y-2">
              {currentMonthDeadlines.map(deadline => {
                const deadlineDate = new Date(deadline.date);
                return (
                  <div key={deadline.id} className="flex justify-between p-2 border-b">
                    <div>
                      <span className="font-medium">{deadline.title}</span>
                      <span className="text-sm text-gray-500 ml-2">({deadline.course})</span>
                    </div>
                    <div className="text-sm">
                      {monthNames[deadlineDate.getMonth()]} {deadlineDate.getDate()}, {deadlineDate.getFullYear()}
                    </div>
                  </div>
                );
              })}
            </div>
          ) : (
            <p className="text-gray-500 italic">No deadlines for this month.</p>
          )}
        </div>
      </div>
    </TeacherLayout>
  );
};

export default InstructorCalendar;
